(1076, 'CSE324', 'Software Development', 3, 2, 'Jan_2016', 2016, 'A', 'Khaled Mahmud Shahriar, Mehnaz Tabassum Mahin, Nazmus Saquib, Md. Tarikul Islam Papon, Dr. Sadia Sharmin', '204', 1, 4, 4, 4, 4, 4, 4, 4, 4, 4, ''),
(1077, 'CSE207', 'Algorithms', 2, 2, 'Jan_2016', 2016, 'A', 'Khaled Mahmud Shahriar, Dr. Mahmuda Naznin', '107', 22, 3, 3, 2, 2, 1, 3, 0, 4, 2, 'This is one of the fundamental courses for CSE students. I think the authority should be careful while choosing the instructor for this course. A good instructor can induce a lifelong interest for students while a bad instructor can destroy it.'),
(1078, 'CSE208', 'Algorithms Sessional', 2, 2, 'Jan_2016', 2016, 'A-', 'Dr. Atif Hasan Rahman, Khaled Mahmud Shahriar, Dr. Mahmuda Naznin, Mehnaz Tabassum Mahin, Dr. Md. Saidur Rahman', '405', 20, 0, 1, 0, 0, 1, 0, 2, 2, 2, 'The offlines given in the classed was unnecessarily difficult. The instructors would find very hard problem, and give us little clue how to solve them. Then we had to search over the internet to find a solution to it. So the competition was who can search the internet best, rather who can formulate algorithm best.\r\nIf the offlines were relatively easy, and proper instruction were given in the lab on how to formulate it, all students could learn a great deal from this course, but very few actually did.\r\nThe purpose for this lab should have been teaching us how to implement the algorithms we learn in the class to solve practical problems, but instead of teaching us, this course judges us if we already know it ourselves.\r\nThis course is a fundamental course in Computer Science, and giving it a credit 0.75 is illogical.'),
(1079, 'CSE209', 'Digital Electronics and Pulse Techniques', 2, 2, 'Jan_2016', 2016, 'D', 'Radi Muhammad Reza, Toufique Ahmed', '109', 0, 1, 0, 1, 0, 0, 0, 0, 0, 0, 'This course material is very hard to find, and those found are very hard to follow. We are not sure about why we CSE students are learning this course. This course should be eliminated and some part of this course should be transferred to EEE 261 course.'),
(1080, 'CSE101', 'Structured Programming Language', 1, 1, 'Jan_2016', 2016, 'A+', 'Dr. Rifat Shahriyar', '107', 4, 1, 1, 2, 1, 2, 0, 1, 2, 3, 'IT should be focused that how we can improve in the subject, process of practice should be cleared.Study process should be cleared. '),
(1081, 'CSE102', 'Structured Programming Language Sessional', 1, 1, 'Jan_2016', 2016, 'A+', 'Dr. A.K.M. Ashikur Rahman, Mohammed Kaysar Abdullah, Dr. Md. Mostofa Akbar, Dr. Rifat Shahriyar, Siddhartha Shankar Das, Toufique Ahmed', '406', 3, 2, 1, 0, 1, 0, 1, 2, 2, 2, 'process of study should be cleared.what examples we can try at home.'),
