(1670, 'CSE208', 'Algorithms Sessional', 2, 2, 'Jan_2016', 2016, 'A+', 'khaledshahriar', '403', 2, 4, 4, 4, 4, 4, 4, 1, 4, 4, 4, 4, 4, 4, 4, 4, 'I apologize as I am no expert. These are some honest opinions towards making this course more interesting.\r\n1. Writing lab report take huge amount of time. At least computer composed lab reports should be accepted. Students copy anyway, from book, internet. If writing lab reports is for learning how to write an algorithm formally, then hand written reports seems less beneficial. To judge a student, effective viva questions should be enough.\r\n2. More offline on interesting problems could have been asked to submit.\r\n3. The students who want to copy, copy anyway. Providing less recognized/complex assignments or lab report cannot stop that. \r\n4. Another, instead of lab report, 5-6 UVA problems can be assigned to solve. \r\n5. Restriction on using STL sometimes takes away interest from algorithm. Code gets lengthy and becomes hard to keep track. Tougher problem with access to STL may be more beneficial. Of course in some cases (like heap in Dijkstra, in stead of priority_queue in C++) using basic data structure is efficient.  '),
