(3531, 'CSE317', 'Numerical Methods', 3, 2, 'Jan_2016', 2016, 'A-', 'wasif', '205', 1, 2, 2, 2, 4, 3, 3, 3, 1, 4, 3, 2, 3, 2, 4, 3, 'I once misbehaved in sir''s class. But he did not rebuke me or anything. I felt very ashamed afterwards. I tried to make up by sitting in front row and trying to listen as best as I could from afterwards. I don''t know if this will reach him. But if it does, I want to apologise to him. '),
(3532, 'CSE317', 'Numerical Methods', 3, 2, 'Jan_2016', 2016, 'A', 'mdmonirulislam', '205', 1, 3, 4, 3, 1, 3, 3, 4, 4, 4, 3, 4, 1, 4, 1, 2, 'We still have not got our class test marks'),
(3533, 'CSE321', 'Computer Networks', 3, 2, 'Jan_2016', 2016, 'A-', 'razi', '205', 1, 4, 4, 3, 2, 4, 4, 3, 4, 4, 3, 4, 4, 4, 4, 4, 'Sir asked in our last class that how was the difficulty of his questions compared to others: Easier, same or harder. I heard everyone answered "harder". I could not participate in that class. If I did, I would have said "Same". Because its not like there was a time that I could not answer his questions entirely. Therefore my parameter for judging a question''s difficulty is the "time needed to complete answering it". And its the same for him and others. Others'' questions take 0 minutes to think and 20 minutes to write. His questions take 15 minutes to think and 5 minutes to write. Therefore, I think they are of the same difficulty. Yes, there may be that issue where his question cannot be figured out. But I don''t think that''s because of the difficulty. That''s the student''s fault entirely. Its not like he questions from out of syllabus'),
(3534, 'CSE301', 'Mathematical Analysis for Computer Science', 3, 2, 'Jan_2016', 2016, 'A+', 'adnan', '205', 3, 2, 2, 2, 2, 2, 2, 2, 2, 2, 2, 2, 2, 2, 4, 2, ''),
